import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <p>Title: </p>
        <input
          style={{ width: '300px', height: '20px' }}
          type="text"
          name="title"
          placeholder="title"
        />
        <p>Code: </p>
        <textarea name="code" id="code" cols="150" rows="60" />
      </div>
    );
  }
}

export default App;
